Buyers Need to Know:


If You Buy Any Goods of Our Company, Please Contact Us in Time If You Have Any Quality Problems Or If You Have Less Hair. We Will Give You Time to Solve the Problems and Give You a Satisfactory Reply:


1. Within 7 Days after Receiving the Goods (Subject to the Date of Receipt of the Waybill), If Any Product with Functional Failure Or Quality Problems Is Found, Please Contact Us in Time; It Will Not Be Accepted Within the Time Limit, and the False Report Will Not Be Accepted Once Verified;


2. Considering That It Is Impossible for Customers to Check All Products One by One after Receiving the Goods, We Allow the Quality Problems to Be Returned Within 7 Days after Receiving the Goods, and We Can Exchange Or Return Them to You; because It Is Impossible for Any Product to Be Flawless and Free of Bad Products, If This Problem Occurs after Receiving the Goods, the Exchange Freight Will Be Borne by One Person (Note: Our Store Only Bears It Once)! Our Store Will Check the Products One by One before Shipment, and Try to Avoid Such Problems!


3. We Will Try Our Best to Satisfy the Customer's Specification of Product Color Or Style, but It May Not Be Satisfied. If the Color and Style Do Not Match, It Will Not Be Returned Or Exchanged (the Customer Can Indicate That the Goods Cannot Be Distributed as Required for out-of-Stock Processing);


4. If the Buyer Is Dissatisfied Or Not Selling Well, the Product Has No Quality Problem, and We Will Not Return Or Exchange the Product;


5. Customers Need to Unpack and Check Whether the Outer Packing Box Is Damaged Or Not When Receiving the Goods. If Any Product Is Damaged Due to Transportation Problems, Please Ask the Relevant Transportation Company to Issue a Certificate Stamped with the Official Seal, and Provide This Certificate to Us, and We Will Assist the Customer to Make a Claim; If the Goods Are Damaged Or Lost Due to Logistics, We Will Not Bear the Relevant Responsibilities;


6. All Customers Should Protect the Integrity of Product Packaging, Complete Accessories Or Related Materials. If the Product Has Quality Problems, We Will Exchange the Product Within the Specified Time; (the Freight for the Separate Exchange Is Borne by the Customer, and It Is Recommended to Replace the next Order)


7. If the Returned Product Packaging Is Incomplete, the Accessories Or Related Materials Are Incomplete; Unauthorized Repair and Modification; Not Used and Stored According to Normal Methods; beyond the Warranty Period of the Product; the Returned Product Is Labeled and Faked, we Will Not Bear the Return;


8. When the Customer Finds the Product Quality Problem and Returns the Product, Please Return It to Our Company by Ordinary Express. the Customer Pays the Freight in Advance. after Receiving the Goods, the Company Will Pay the Freight and the Actual Cost of the Product According to the Express List, if the Customer Returns the Product Directly without Communicating with the Customer Service, We Will Not Accept It. Thank You for Your Cooperation, and the Communication Starts from the Heart.

